sub source
{
	my $ur=shift;
    my $cont=shift;
    my $ref=shift;
    my $method=shift;
	my $browser=shift;
	my $content_type=shift;
	my $cookie=shift;
	my $cookie_jar= HTTP::Cookies->new(file=>$0."_cookie.txt",autosave => 1,);
	my $ua=LWP::UserAgent->new;
	$ua->agent($browser);
	netfail:
    my $request=HTTP::Request->new("$method"=>$ur);
    $request->header("Content-Type"=>"$content_type");
	if($cookie ne '')
	{
		$request->header("Cookie"=>"$cookie");
    }
	if($ref ne '')
	{
		$request->header("Referer"=>"$ref");
    }
    if(lc $method eq 'post')
    {
		$request->content($cont);
    }
    my $res=$ua->request($request);
    $cookie_jar->extract_cookies($res);
    $cookie_jar->save;
    $cookie_jar->add_cookie_header($request);
    my $code=$res->code;
    #print"\n $code";
    if($code==200)
    {
		my $content=$res->content();
		# $content=decode_entities($content);
		return ($content,$code);
    }
    elsif($code=~m/50/is)
    {
		# my $content;
		# print"\n $count Net Failure";
		# $count++;
		# return ($content,$code);
		my $content;
		print"\n $count Net Failure";
		$count++;
		return ($content,$code);
    }
    elsif($code=~m/30/is)
	{
		# print "CODE::$code\n";
		# my $loc=$res->header("Location");
		# $loc=URI::URL->new_abs($loc,$ur);
		# print "$loc\n";
		# return $loc;
    	# &getcont($loc,'','','GET');
		my $loc=$res->header("Location");
        print "\nLocation: $loc";
        my $request1=HTTP::Request->new(GET=>$loc);
        $request1->header("Content-Type"=>"application/x-www-form-urlencoded");
        my $res1=$ua->request($request1);
        $cookie_jar->extract_cookies($res1);
        $cookie_jar->save;
        $cookie_jar->add_cookie_header($request1);
        my $content1=$res1->content();
		return ($content1,$code);
	}
    elsif($code=~m/40/is)
    {
		my $content=$res->content();
		return ($content,$code);
		
    }
}

sub proxy_source
{
	my($ur,$cont,$ref,$method,$browser,$content_type,$cookie)=@_;
	my $ua=LWP::UserAgent->new();
	$ua->agent("$browser");
	$ua->max_redirect(0);
	my $cookie_jar = HTTP::Cookies->new(file=>$0."_cookie.txt",autosave => 1,);                    
	$ua->cookie_jar($cookie_jar);
	$cookie_jar->save;
    netfail:
    my $request=HTTP::Request->new("$method"=>$ur);
	our ($ip);
	if($code=~m/5/is)
	{
		if($ur=~m/https/is)
		{
			print "UR:$ur\n";
			($ip)=getproxy();
			$ua->proxy('https', $ip);
		}	
		else
		{
			print "UR:$ur\n";
			($ip)=getproxy();
			$ua->proxy('http', $ip);
		}
	}	
	print "\nIP Address:$ip\n";
    # $request->header("Content-Type"=>"application/x-www-form-urlencoded; charset=UTF-8");
	$request->header("Content-Type"=>"$content_type");
	if($cookie ne '')
	{
		$request->header("Cookie"=>"$cookie");
    }
    if($ref ne '')
    {
   
        $request->header("Referer"=>"$ref");
    }
    if(lc $method eq 'post')
    {
        $request->content($cont);
    }
    my $res=$ua->request($request);
    $cookie_jar->extract_cookies($res);
    $cookie_jar->save;
    $cookie_jar->add_cookie_header($request);
    $code=$res->code;
    print"\n$code\n";
    if($code==200)
    {
        my $content=$res->content();
		# $content=decode_entities($content);
        return ($content,$ip);
    }
    elsif($code=~m/50/is)
    {
        print"\nNet Failure\n";
        #sleep(30);
        goto netfail;
    }
    elsif($code=~m/30/is)
    {
        print "CODE::$code\n";
		my $loc=$res->header("Location");
		$loc=URI::URL->new_abs($loc,$ur);
		print "\n$loc\n";
		getcont($loc,'','','GET');
		# my $loc=$res->header("Location");
        # print "\nLocation: $loc";
        # my $request1=HTTP::Request->new(GET=>$loc);
        # $request1->header("Content-Type"=>"application/x-www-form-urlencoded; charset=UTF-8");
        # my $res1=$ua->request($request1);
        # $cookie_jar->extract_cookies($res1);
        # $cookie_jar->save;
        # $cookie_jar->add_cookie_header($request1);
        # my $content1=$res1->content();
        # return $content1;
		# return $loc;
		# return ($content1,$ip);
    }
    elsif($code=~m/4/is)
    {
		my $content=$res->content();
		#$content=decode_entities($content);
		if($content=~m/(?:We're\s*sorry)/is)
		{
			$code="500";
			goto netfail;
		}
		goto netfail;
        #return $content;
        print "\nURL Not found\n";
    }
}
sub forif
{
	my $data1=shift;
	my $data2=shift;
	my $rdata;
	if($data1=~m/$data2/is)
	{
		$rdata=trim($1);
	}
	return $rdata;
}
sub datetime()
{
	my $datetime=localtime->strftime('%Y-%m-%d %H:%M:%S');
	my $time=time();
	# return ($datetime);
	return ($datetime,$time);
}

#-------------->To find time difference:
sub time_difference()
{
	my $strtime=shift;
	my $endtime=shift;
	my $timediff;
	$timediff=$endtime-$strtime;
	return $timediff;
}

#-------------->Function to return ip
sub ip()
{
	my $public_ip=get("http://myexternalip.com/raw");
	chomp($public_ip);
	# Get the local system's IP address that is "en route" to "the internet":
	my $config_list = `ipconfig`;
	my $local_ip;
	if($config_list=~m/IPv4[^>]*?(172[^>]*?)\s/is)
	{
		$local_ip=$1;
	}
	else
	{
		$local_ip = Net::Address::IP::Local->public;
	}
	return ($public_ip,$local_ip);
}

#------------->Function to return Total Number bytes of a page loading...
sub bytes()
{
	
	my $file=shift;
	my $total_size=length($file); # length - to get the size
	return $total_size;
	
}
sub bytes1()
{
	# my $total_size=length($file); # length - to get the size
	my $file=shift;
	open FC,">search_con.html";
	print FC "$file";
	close FC;
	my $total_size=-s("search_con.html"); # length - to get the size
	return $total_size;
	
}
